import { groupBy, map } from "lodash";
import React from "react";
import Layout from "../../components/layout";
// import { groupBy, uniq } from "lodash";

const News = ({ articles }) => {
  console.log({ articles });

  const byCategory = articles.reduce((acc, article) => {
    const category = article.category.name;
    const newObj = { ...article, category: article.category.name };
    console.log({ newObj });
    return [...acc, newObj];
  }, []);

  const grouped = groupBy(byCategory, "category");

  console.log({ grouped });
  const mapped = map(grouped, (article) => {
    return <div key={article.slug}>{article.title}</div>;
  });
  return <Layout>{mapped}</Layout>;
};

export default News;

